const Whystudyabroad =()=>{
    return (
        <div className='whystudyabroadpage'>
         <Header></Header>
             <Navbar></Navbar>
             <WhyStudyAbroad ></WhyStudyAbroad>
             <StudyAbroad ></StudyAbroad>
             <StudyAbroadIntakes></StudyAbroadIntakes> 
             <EmploymentProspectsAbroad></EmploymentProspectsAbroad>
