             <IIECGuidetoStudyingAbroad></IIECGuidetoStudyingAbroad>
             <TypesofOfferLetters></TypesofOfferLetters>
             <BottomBannerfirst></BottomBannerfirst>
             <YourNextStep></YourNextStep>
             <Footer></Footer>

       </div>
    )}

    export default Whystudyabroad ;
